import React, { Component } from "react";
import Tabs from "react-bootstrap/Tabs";
import Tab from "react-bootstrap/Tab";
import Education from "./education";

class Navbar extends Component {
  state = {
    tabs: [
      { id: 1, value: "BACKGROUND" },
      { id: 2, value: "EDUCATION", component: <Education /> },
      { id: 3, value: "EXPERIENCE" },
      { id: 4, value: "SKILLS" },
      { id: 5, value: "SOFTWARE" }
    ]
  };

  render() {
    return (
      <Tabs justify defaultActiveKey="background">
        <Tab eventKey="background" title="BACKGROUND"></Tab>
        <Tab eventKey="education" title="EDUCATION">
          <Education />
        </Tab>
        <Tab eventKey="experience" title="EXPERIENCE"></Tab>
        <Tab eventKey="skills" title="SKILLS"></Tab>
        <Tab eventKey="software" title="SOFTWARE"></Tab>
      </Tabs>
    );
  }
}

export default Navbar;
